struct audio_t {
  volatile unsigned int control;
  volatile unsigned char rarc;
  volatile unsigned char ralc;
  volatile unsigned char warc;
  volatile unsigned char walc;
  volatile unsigned int ldata;
  volatile unsigned int rdata;
};

struct audio_t *const audiop = ((struct audio_t *)0xff203040);

void audio_playback_mono(int *samples, int n) {
  int i;

  audiop->control = 0x8;  // clear the output FIFOs
  audiop->control = 0x0;  // resume input conversion
  for (i = 0; i < n; i++) {
    // wait till there is space in the output FIFO
    while (audiop->warc == 0)
      ;
    audiop->ldata = samples[i];
    audiop->rdata = samples[i];
	  //*LED = i;
  }
}

void audio_setup(){
	audiop->control = 0x8;  // clear the output FIFOs
  	audiop->control = 0x0;  // resume input conversion	
}

void audio_playback_mono2(int *samples, int* i, int n, int samples_per_chunk) {
    int chunk_samples_played = 0; // Initialize the number of samples played in the current chunk

    while (chunk_samples_played < samples_per_chunk && *i < n) {
        if (audiop->warc != 0) {
            audiop->ldata = samples[*i];
            audiop->rdata = samples[*i];
            *i += 1;
            chunk_samples_played++; // Increment the number of samples played in the current chunk
        } else {
            // If there's no space in the output FIFO, exit the loop to avoid blocking
            break;
        }
    }
}


