void wait_for_vsync() {
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    *pixel_ctrl_ptr = 1;
    int status = *(pixel_ctrl_ptr + 3) & 0b1;

    while (status != 0x0) {
        status = *(pixel_ctrl_ptr + 3) & 0b1;
    }
}

