void playerInput(int keyboard, Character *player, unsigned char *byte1, unsigned char *byte2, unsigned char up, unsigned char down, unsigned char right, unsigned left){
    //Goal is to recognize player input and weather they are holding down the button or not
    //Variables to store the data read from the PS/2 input.
    int ps2_data;
    char validRead;

    //The last 3 bytes read (byte1 is the most recent).
    
  

    //The main loop of the program, which polls the PS/2 input and
    //illuminates LEDS depending on which keys are pressed.

    //Keyboard input processing. Keyboard input is read one byte at a time.
    //Every time a read is performed of the PS/2 control register, it discards the 
    //last byte.
    if(keyboard == 1){
        ps2_data = *(ps2_ctrl_ptr1);
    }
    else{
        ps2_data = *(ps2_ctrl_ptr0);
    }
    

    validRead = ((ps2_data & 0x8000) != 0);

    if (validRead)
    {
        //Update the last 2 bytes read to reflect the current read.
        *byte2 = *byte1;
        *byte1 = (ps2_data & 0xFF);
        
        int regSpeed = 10;
        int jump = 20;

        /* 
        Button hold and release looks like:     0xII 0xF1 0xII 
        if held:                                0xII 0xII 0xF1 0xII 
         */
        

        ///////////////////////////////////////Checking if button released
        if(*byte2 == 0xF0){
            //y-movement
            if(*byte1 == up){
                player->speedY = 0;
                
                //Reseting Dashes
                player->rightDashCounter = 0;
                player->leftDashCounter = 0;
                
            }
            else if(*byte1 == down){
                player->speedY = 0;
                player->kick = 0;
                
                
                //Reseting Dashes
                player->rightDashCounter = 0;
                player->leftDashCounter = 0;

            }
            //x-movement
            else if(*byte1 == right){
                player->speedX = 0;

                //player->rightDashCounter++; turned off
                player->leftDashCounter = 0; //Reset Left Dash

            }
            else if(*byte1 == left){
                player->speedX = 0;
                
                player->rightDashCounter = 0; //Reseting Right Dash
                //player->leftDashCounter++; //Proccing Left Dash Counter

            }
        }

        ///////////////////////////////////////Checking if button pressed
        else{
            //y-movement 
            if(*byte1 == up){
                player->speedY = -jump;
            }
            else if(*byte1 == down){
                player->speedY = regSpeed;
                player->kick = 1;
            }
            //x-movement
            else if(*byte1 == right){
                player->speedX = regSpeed;
            }
            else if(*byte1 == left){
                player->speedX = -regSpeed;   
            }
        }

        

    }
    ///////////Moved to Main
    //applyDash(player); //Applying Dash speed if dashing conditions met
    //applyPlayerSpeed(player); //Applying Speed to Player
}


void applyPlayerSpeed(Character *player){
    player->x += player->speedX;
    player->y += player->speedY;

    //Height limit
    if((player->y <= groundedCharacterY - jumpHeight)){
        player->y = groundedCharacterY - jumpHeight;
    }
}

void applyDash(Character *player){
    int dashSpeed = 40;

    if(player->Dashed){
        player->speedX = 0;
        player->Dashed = 0;
    }

    //Checking if Dash Needed 
    if(player->rightDashCounter == 2){
        player->speedX = dashSpeed;
        player->rightDashCounter = 0;
        player->Dashed = 1;
    }
    else if(player->leftDashCounter == 2){
        player->speedX = -dashSpeed;
        player->leftDashCounter = 0;
        player->Dashed = 1;
    }
}

void cpuRight(Character *player, Ball *ball){
    int regSpeed = 3;
    int jump = 20;
    if(ball->x + ballDiameter < player->x){
        player->speedX = -regSpeed;
        player->kick = 1;
        player->speedY = 0;
    }
    else if(ball->x > player->x + characterLengthY){
        player->speedX = regSpeed;
        player->speedY = -jump;
        player->kick = 0;
    }

}
  

